import React from "react";
import web from "../src/images/4.JPG";
import { NavLink } from "react-router-dom";


const Error=()=>{
    return(
        <>
     <div className="container">
    <div className="row">
    <div className="col-10 mx-auto d-flex">

        <h3>Oops; Sorry, but the page you were trying to view does not exist.</h3>
        <img src={web} className="img-fluid" alt="error-img"/>
        <NavLink className="btn btn-outline-info btn-lg " to="/home">Back To Home </NavLink>

       </div>
       </div></div>



        </>


    );
};
export default Error;
